const show=async e=>{let t,r,o;await e.start();try{t=parseInt(document.getElementById("PARAM_COLOR_AMT").value),r=parseInt(document.getElementById("PARAM_GRP_CNT").value),o=document.getElementById("target"),o.innerHTML=""}catch(e){throw console.error(e),e}const n=new Array;for(let e=0;e<t;e++)n.push(new Color);const a=Color.sorted(n),l=Color.sorted(n,r);for(let e=0;e<t;e++){const t=[n[e].getHex(),a[e].getHex(),l[e].getHex()];var s=t.map(e=>`<td class="cell" style="background-color: ${e};">${e}</td>`).reduce((e,t)=>e+t);o.innerHTML+=`<tr>${s}</tr>`}await e.finish()};